function (doc) {

  if(doc.table){
    index("table", doc.table, {"store": true, "index": true});  
  }

  if(doc.virtual_phone){
    index("virtual_phone", doc.virtual_phone, {"store": true, "index": true});
  }

  if(doc.data_id){
    index("data_id", doc.data_id, {"store": true, "index": true});
  }

  if(doc.page_name){
    index("page_name", doc.page_name, {"store":true, "index":true});
  }

  if(doc.user_id){
    index("user_id", doc.user_id, {"store":true, "index":true});
  }

  if(doc.seq){
    index("seq", doc.seq, {"store":true, "index":true});
  }

  if(doc.visible){
    index("visible", doc.visible, {"store":true, "index":true});
  }

